import React from "react";
import "./index.css";
import BannerData , {BannerBox} from "./Data";
 

function box(values){
    return(
        <BannerBox h2={values.h2}
            
        />
    )
}
function Banner(){
    return(
        <div className="banner">
            <h1>Welcome to Projection</h1>
            <div className="banner-box">
                    {BannerData.map(box)} 
            </div>
        </div>
    );
}
export default Banner;
